import './App.css';
import Create from './components/create';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="main">
        <h2 className="main-header">React Crud Operations</h2>
        <div>

        <Link to="/create">Create</Link>

        </div>

      <Switch>
        <Route path='/create'>
          <Create />
        </Route>
      </Switch>
      </div>
    </Router>
  );
}

export default App;
